import React from 'react';
import classes from '../POSTS_NEWPAGE/posts_newpage.module.css';
import Postspage from '../posts-page/posts-page';
import Postpage from '../post-page/post-page';
import { Contextt } from '../../app2';
import ''


export default () => {
    return(
        <Contextt.Consumer>
            {
                (obj) => {
                    return(
                        <div className={classes.posts}>
                            <div className={classes.posts_one}><Postspage/></div>
                            <div className={classes.posts_two}>
                            {obj.post === -1 ? '' : <h1>{obj.posts[obj.post].title}</h1>}
                                {obj.post === -1 ? 'Choose some posts' : <Postpage/>}
                            </div>
                        </div>
                    );
                }
            }
        </Contextt.Consumer>
    );
}
